import React from "react";
import { NavLink } from 'react-router-dom';

function Home() {
  return (
    <>
      <div className="unlogged-nav-bar">
        <div className="nav-button empty"><NavLink to="/login">Login</NavLink></div>
        <div className="nav-button filled"><NavLink to="/signup">Signup</NavLink></div>
        <div className="nav-icon settings"><i class="fa fa-cog" aria-hidden="true"></i></div>
      </div>
      <h1>The Forest</h1>
      <div className="nav-button empty"><NavLink to="/about">About</NavLink></div>
      <div className="background-image home-trees"><img alt="trees" src=""/></div>
    </>
  )
}

export default Home
